import React, { Component } from 'react';
import Book from './containers/Book';
import { Container } from 'react-bootstrap';

class DutchLibary extends Component {
    render() {
        return (
            <Container>DUTCH BOOKS
                <Book language='dutch' />
            </Container>
        )
    }
}

export default DutchLibary;
